import React, { useState, useEffect } from 'react';
import logo from './logo.svg';
import { BrowserRouter, Routes, Route } from "react-router-dom"
import './App.css';
import Auth from "./Auth";

function App() {
  const [currentUserName, setCurrentUserName] = useState("default");
  const [currentUserUID, setCurrentUserUID] = useState("default");
  const [currentUserPassword, setCurrentUserPassword] = useState("default");

  useEffect(() => {
    fetch('session/dani').then(res => res.json().then(data => {
      setCurrentUserName(data[1].Username);
      setCurrentUserUID(data[1].UID)
      setCurrentUserPassword(data[1].Password)
    }))
  }, []);

  return (
      <BrowserRouter>
      <Routes>
        <Route path="/auth" element={<Auth />} />
        <Route path="/" element={<Auth />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
